#include <iostream>
#include <vector>
#include <queue>

using namespace std;

class Solution {
    int visited[101][101] = {0};

public:
    int shortestDistance(vector<vector<int>> &maze, vector<int> &start, vector<int> &destination) {
        int xLength = maze.size() - 1;
        int yLength = maze[0].size() - 1;

        queue<tuple<int, int, int>> posQueue;
        posQueue.push(tuple<int, int, int>(start[0], start[1], 0));
        visited[start[0]][start[1]] = 1;

        while (!posQueue.empty()) {
            tuple<int, int, int> pos = posQueue.front();
            posQueue.pop();

            //Ball rolls upwards
            int currentX = get<0>(pos);
            if (currentX > 0 && maze[currentX - 1][get<1>(pos)] != 1) {
                int numberOfSteps = get<2>(pos);
                while (currentX >= 0 && maze[currentX][get<1>(pos)] == 0) currentX--, numberOfSteps++;
                currentX++, numberOfSteps--;

                if (visited[currentX][get<1>(pos)] == 0 || visited[currentX][get<1>(pos)] > numberOfSteps) {
                    visited[currentX][get<1>(pos)] = numberOfSteps;
                    posQueue.push(tuple<int, int, int>(currentX, get<1>(pos), numberOfSteps));
                }
            }


            //Ball rolls downwards
            currentX = get<0>(pos);
            if (currentX < xLength && maze[currentX + 1][get<1>(pos)] != 1) {
                int numberOfSteps = get<2>(pos);
                while (currentX <= xLength && maze[currentX][get<1>(pos)] == 0) currentX++, numberOfSteps++;
                currentX--, numberOfSteps--;

                if (visited[currentX][get<1>(pos)] == 0 || visited[currentX][get<1>(pos)] > numberOfSteps) {
                    visited[currentX][get<1>(pos)] = numberOfSteps;
                    posQueue.push(tuple<int, int, int>(currentX, get<1>(pos), numberOfSteps));
                }
            }


            //Ball rolls leftwards
            int currentY = get<1>(pos);
            if (currentY > 0 && maze[get<0>(pos)][currentY - 1] != 1) {
                int numberOfSteps = get<2>(pos);

                while (currentY >= 0 && maze[get<0>(pos)][currentY] == 0) currentY--, numberOfSteps++;
                currentY++, numberOfSteps--;

                if (visited[get<0>(pos)][currentY] == 0 || visited[get<0>(pos)][currentY] > numberOfSteps) {
                    visited[get<0>(pos)][currentY] = numberOfSteps;
                    posQueue.push(tuple<int, int, int>(get<0>(pos), currentY, numberOfSteps));
                }
            }


            //Ball rolls rightwards
            currentY = get<1>(pos);
            if (currentY < yLength && maze[get<0>(pos)][currentY+1] != 1) {
                int numberOfSteps = get<2>(pos);

                while (currentY <= yLength && maze[get<0>(pos)][currentY] == 0) currentY++, numberOfSteps++;
                currentY--, numberOfSteps--;

                if (visited[get<0>(pos)][currentY] == 0 || visited[get<0>(pos)][currentY] > numberOfSteps) {
                    visited[get<0>(pos)][currentY] = numberOfSteps;
                    posQueue.push(tuple<int, int, int>(get<0>(pos), currentY, numberOfSteps));
                }
            }
        }

        return (visited[destination[0]][destination[1]] == 0) ? -1 : visited[destination[0]][destination[1]]; //Destination not reached
    }
};


